import React from 'react';

function Confirm_btn (props) {
    const bg_color = props.bg_color;
    
    return (
        <div class='confirm-btn' style={{backgroundColor:{bg_color}}} onClick={props.onClick}>
            <p>{props.title}</p>
        </div>
    )
}

export default Confirm_btn;
